import StringIO 

from django.test import TestCase

from models import InboundFaxProcessor

class EFaxApiTest(TestCase):
    def test_xml_processing(self):        
        """
        efax sends a post request with a single 'xml' parameter when they recieve a fax.
        
        the value of the parameter is an xml document that contains metadata and a (set of)
        base64 encoded fax page(s). the metadata includes barcodes extracted from the document, 
        if the account was setup in this way. 
        
        """
        xmlstream = StringIO.StringIO(SAMPLE1)
        parsed_fax = InboundFaxProcessor(xmlstream).process_message()
        self.failUnless(parsed_fax)
        self.failUnlessEqual(parsed_fax.account_id, '1234567890')
        self.failUnless(parsed_fax.faxbarcode_set.all())

